import React from 'react';

import classes from './Header/module.css'
import Carrito from './../Carrito/Carrito';
import MediaLinks from './../MediaLinks/MediaLinks';

function Header() {
    return (
        <div className={classes.Header}>
            <MediaLinks />
            <Carrito />
        </div>
    )
}

export default Header
